drop database Estacionamento;
create database Estacionamento;
use Estacionamento;
create table Clientes(
	idCli integer primary key auto_increment,
	nome varchar(40) not null,
	placa varchar(7) not null,
	horEntra time not null,
	horSaida time
	);
create table Funcionarios(
	idFunc integer primary key auto_increment,
	priNome varchar(20) not null,
	sobrenome varchar(20) not null,
	tel varchar(15)
	);
create table if not exists Vagas(
	nVaga varchar(4) primary key,
	andar integer not null,
	bloco varchar(1) not null,
	tipo varchar(12) not null
	);
	


	
show tables;
describe Clientes;
describe Funcionarios;
describe Vagas;

select * from Clientes;
select * from Vagas;
select * from Funcionarios;